create table token_sector
(
    id         bigserial
        constraint token_sector_pk
            primary key,
    sector     text,
    token_name text
        constraint token_sector_crypto_project_name_fk
            references crypto_project (name)
);

alter table token_sector
    owner to application;

create unique index token_sector_id_uindex
    on token_sector (id);

